sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var statusDetails=inputs.detail;
var response=inputs.response; 
if( response && !response.head)
response=JSON.parse(response);

if(response.head.status=="Success" || response.head.statusCode=="200"){
    outputs.status="success";
    outputs.code="200";
    outputs.link=response.body.link
}
else{
    outputs.detail=statusDetails;
    var errorMsg=[];
    outputs.status="failure";
    outputs.code="500";
    if(response.head && response.head.errordetails && response.head.errordetails.length){
        response.head.errordetails.forEach(function(error){
            errorMsg.push(error.msg);
        });
    }
    errorMsg=errorMsg.toString();
    outputs.msg=errorMsg;
}

})(inputs, outputs);

